  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" render={ (props) => <Login { ...props } /> } />
        <Route path="/comidas/:id" render={ (props) => <Item { ...props } /> } />
        <Route path="/bebidas/:id" render={ (props) => <Item { ...props } /> } />
